    "\n                After the due date has passed, you can review the exam, but you cannot change your answers.\n            ": "\n\u067e\u0633 \u0627\u0632 \u0627\u062a\u0645\u0627\u0645 \u0645\u0648\u0639\u062f \u0645\u0642\u0631\u0631\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u0645\u062a\u062d\u0627\u0646 \u0631\u0627 \u0628\u0627\u0632\u0628\u06cc\u0646\u06cc \u06a9\u0646\u06cc\u062f\u060c \u0627\u0645\u0627 \u0627\u0645\u06a9\u0627\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u067e\u0627\u0633\u062e\u200c\u0647\u0627 \u0631\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u0646\u062f\u0627\u0631\u06cc\u062f.",
    "\n                The time allotted for this exam has expired. Your exam has been submitted and any work you completed\n                will be graded.\n            ": "\n \u0632\u0645\u0627\u0646 \u062f\u0631 \u0646\u0638\u0631 \u06af\u0631\u0641\u062a\u0647\u200c\u0634\u062f\u0647 \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0622\u0632\u0645\u0648\u0646 \u0628\u0647 \u067e\u0627\u06cc\u0627\u0646 \u0631\u0633\u06cc\u062f\u0647\u200c\u0627\u0633\u062a. \u0622\u0632\u0645\u0648\u0646 \u0634\u0645\u0627 \u0627\u0631\u0633\u0627\u0644 \u0634\u062f\u0647\u200c\u0627\u0633\u062a \u0648 \u0647\u0631 \u06a9\u0627\u0631\u06cc \u06a9\u0647 \u0627\u0646\u062c\u0627\u0645 \u062f\u0647\u06cc\u062f \n\u0646\u0645\u0631\u0647 \u062f\u0627\u062f\u0647 \u0645\u06cc\u200c\u0634\u0648\u062f.",
