    " From this point in time, you must follow the <a href=\"%(link_urls.online_proctoring_rules)s\" target=\"_blank\">online proctoring rules</a> to pass the proctoring review for your exam. ": "\u062f\u0631 \u0627\u06cc\u0646 \u0646\u0642\u0637\u0647 \u0627\u0632 \u0632\u0645\u0627\u0646\u060c \u0634\u0645\u0627 \u0628\u0627\u06cc\u062f <a href=\"%(link_urls.online_proctoring_rules)s\" target=\"_blank\">\u0642\u0648\u0627\u0646\u06cc\u0646 \u062d\u0641\u0627\u0638\u062a \u0628\u0631\u062e\u0637</a> \u0631\u0627 \u0628\u0631\u0627\u06cc \u0642\u0628\u0648\u0644\u06cc \u062f\u0631 \u0628\u0631\u0631\u0633\u06cc \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647 \u0622\u0632\u0645\u0648\u0646 \u062e\u0648\u062f \u0631\u0627 \u062f\u0646\u0628\u0627\u0644 \u06a9\u0646\u06cc\u062f.",
