    "After the subsection\\'s due date has passed, learners can no longer access its content. The subsection remains included in grade calculations.": "\u067e\u0633 \u0627\u0632 \u067e\u0627\u06cc\u0627\u0646 \u062a\u0627\u0631\u06cc\u062e \u0645\u0642\u0631\u0631 \u0632\u06cc\u0631\u0628\u062e\u0634\u060c \u0627\u0641\u0631\u0627\u062f \u062f\u06cc\u06af\u0631 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u0628\u0647 \u0645\u062d\u062a\u0648\u0627\u06cc \u0632\u06cc\u0631\u0628\u062e\u0634 \u062f\u0633\u062a\u0631\u0633\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u0646\u062f. \u0632\u06cc\u0631\u0628\u062e\u0634 \u062f\u0631 \u0645\u062d\u0627\u0633\u0628\u0627\u062a \u0646\u0645\u0631\u0647 \u0628\u0627\u0642\u06cc \u0645\u06cc\u200c\u0645\u0627\u0646\u062f",
