    "An error occurred retrieving your email. Please try again later, and contact technical support if the problem persists.": "\u0647\u0646\u06af\u0627\u0645 \u0628\u0627\u0632\u06cc\u0627\u0628\u06cc \u0631\u0627\u06cc\u0627\u0646\u0627\u0645\u06c0 \u0634\u0645\u0627 \u062e\u0637\u0627\u06cc\u06cc \u0631\u062e \u062f\u0627\u062f. \u0644\u0637\u0641\u0627\u064b \u067e\u0633 \u0627\u0632 \u0645\u062f\u062a\u06cc \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u06cc\u062f \u0648 \u062f\u0631 \u0635\u0648\u0631\u062a \u0627\u062f\u0627\u0645\u06c0 \u0645\u0634\u06a9\u0644 \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc \u0641\u0646\u06cc \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u06cc\u062f.",
    "An error occurred when signing you in to %s.": "\u0647\u0646\u06af\u0627\u0645 \u0648\u0631\u0648\u062f \u0628\u0647 \u0633\u0627\u0645\u0627\u0646\u0647%s \u062e\u0637\u0627\u06cc\u06cc \u0631\u0648\u06cc \u062f\u0627\u062f.",
    "An error occurred while attempting to retrieve or save the information below. Please try again later.": "\u0647\u0646\u06af\u0627\u0645 \u0628\u0627\u0632\u06cc\u0627\u0628\u06cc \u06cc\u0627 \u0630\u062e\u06cc\u0631\u06c0 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0632\u06cc\u0631\u060c \u062e\u0637\u0627\u06cc\u06cc \u0631\u062e \u062f\u0627\u062f. \u0644\u0637\u0641\u0627\u064b \u0628\u0639\u062f\u0627\u064b \u062f\u0648\u0628\u0627\u0631\u0647 \u0627\u0645\u062a\u062d\u0627\u0646 \u06a9\u0646\u06cc\u062f.",
    "An error occurred while looking up team membership. Try refreshing the page.": "\u062e\u0637\u0627\u06cc\u06cc \u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u06cc\u0627\u0641\u062a\u0646 \u0627\u0639\u0636\u0627\u0621 \u062a\u06cc\u0645 \u0631\u062e \u062f\u0627\u062f. \u0635\u0641\u062d\u0647 \u0631\u0627 \u062a\u0627\u0632\u0647 \u06a9\u0646\u06cc\u062f.",
    "An error occurred while removing the member from the team. Try again.": "\u062f\u0631 \u0647\u0646\u06af\u0627\u0645 \u062d\u0630\u0641 \u0627\u06cc\u0646 \u0639\u0636\u0648 \u0627\u0632 \u062a\u06cc\u0645 \u062e\u0637\u0627\u06cc\u06cc \u0631\u062e \u062f\u0627\u062f. \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.",
    "An error occurred.": "\u062e\u0637\u0627\u06cc\u06cc \u0631\u062e \u062f\u0627\u062f.",
