    "Any course progress or grades from your current session will be lost.": "\u067e\u06cc\u0634\u0631\u0641\u062a\u200c\u0647\u0627\u06cc \u0634\u0645\u0627 \u0648 \u0646\u0645\u0631\u0627\u062a \u062f\u0631 \u0627\u06cc\u0646 \u062f\u0648\u0631\u06c0 \u0622\u0645\u0648\u0632\u0634\u06cc \u062c\u0627\u0631\u06cc \u0627\u0632 \u062f\u0633\u062a \u062e\u0648\u0627\u0647\u062f \u0631\u0641\u062a.",
