    "Are you sure you want to unenroll from the verified {certNameLong} track of {courseName} ({courseNumber})?": "\u0622\u06cc\u0627 \u0645\u0627\u06cc\u0644\u06cc\u062f \u0627\u0632 \u0645\u0633\u06cc\u0631 {certNameLong} \u0627\u0632 \u062f\u0648\u0631\u06c0 {courseName} ({courseNumber}) \u0644\u063a\u0648 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u06a9\u0646\u06cc\u062f\u061f",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})?": "\u0622\u06cc\u0627 \u0627\u0632 \u0644\u063a\u0648 \u062b\u0628\u062a\u200c\u0646\u0627\u0645  {courseName} ({courseNumber}) \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062f\u0627\u0631\u06cc\u062f\u061f ",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})? You will be refunded the amount you paid.": "\u0622\u0650\u0627 \u0627\u0632 \u0644\u063a\u0648 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u062f\u0631 \u062f\u0648\u0631\u06c0 \u0622\u0645\u0648\u0632\u0634\u06cc {courseName} ({courseNumber})?\u00a0 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062f\u0627\u0631\u06cc\u062f\u061f \u0645\u0628\u0644\u063a \u067e\u0631\u062f\u0627\u062e\u062a\u06cc \u0628\u0647 \u062d\u0633\u0627\u0628 \u0634\u0645\u0627 \u0628\u0627\u0632 \u06af\u0631\u062f\u0627\u0646\u062f\u0647 \u062e\u0648\u0627\u0647\u062f \u0634\u062f.",
    "Are you sure you wish to delete this item. It cannot be reversed!\n\nAlso any content that links/refers to this item will no longer work (e.g. broken images and/or links)": "\u0622\u06cc\u0627 \u0627\u0632 \u062d\u0630\u0641 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062f\u0627\u0631\u06cc\u062f. \u0627\u06cc\u0646 \u0639\u0645\u0644 \u0628\u0631\u06af\u0634\u062a\u200c\u0646\u0627\u067e\u0630\u06cc\u0631 \u0627\u0633\u062a!\n\n\u0647\u0645\u0686\u0646\u06cc\u0646 \u0647\u0631 \u06cc\u06a9 \u0627\u0632 \u0645\u0637\u0627\u0644\u0628 \u067e\u06cc\u0648\u0646\u062f\u062e\u0648\u0631\u062f\u0647 \u0628\u0647 \u0627\u06cc\u0646 \u0645\u0648\u0631\u062f \u06cc\u0627 \u0627\u0631\u062c\u0627\u0639 \u0634\u062f\u0647 \u0628\u0647 \u0622\u0646\u060c \u062f\u06cc\u06af\u0631 \u06a9\u0627\u0631 \u0646\u062e\u0648\u0627\u0647\u0646\u062f \u06a9\u0631\u062f (\u0645\u062b\u0644 \u062a\u0635\u0627\u0648\u06cc\u0631 \u0648 \u06cc\u0627 \u067e\u06cc\u0648\u0646\u062f\u0647\u0627\u06cc \u0645\u06cc\u0627\u0646\u200c\u0628\u0631)",
    "Are you sure?": "\u0622\u06cc\u0627 \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062f\u0627\u0631\u06cc\u062f\u061f",
    "As part of the verification process, you take a photo of both your face and a government-issued photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u0628\u0647\u200c\u0639\u0646\u0648\u0627\u0646 \u0628\u062e\u0634\u06cc \u0627\u0632 \u0631\u0648\u0646\u062f \u062a\u0623\u06cc\u06cc\u062f\u060c \u0634\u0645\u0627 \u0647\u0645 \u0627\u0632 \u0686\u0647\u0631\u06c0 \u062e\u0648\u062f \u0648 \u0647\u0645 \u0627\u0632 \u062a\u0636\u0648\u06cc\u0631 \u06a9\u0627\u0631\u062a \u0634\u0646\u0627\u0633\u0627\u06cc\u06cc \u0645\u0639\u062a\u0628\u0631 \u062e\u0648\u062f \u0639\u06a9\u0633 \u0645\u06cc\u200c\u06af\u06cc\u0631\u06cc\u062f. \u0633\u0631\u0648\u06cc\u0633 \u0627\u062d\u0631\u0627\u0632\u0647\u0648\u06cc\u062a \u0645\u0627 \u0628\u0627 \u0645\u0642\u0627\u06cc\u0633\u06c0 \u0627\u06cc\u0646 \u062f\u0648 \u062a\u0635\u0648\u06cc\u0631\u060c \u0647\u0648\u06cc\u062a \u0634\u0645\u0627 \u0631\u0627 \u062a\u0623\u06cc\u06cc\u062f \u0645\u06cc\u200c\u06a9\u0646\u062f.",
    "As part of the verification process, you take a photo of both your face and a photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0628\u062e\u0634\u06cc \u0627\u0632 \u0631\u0648\u0646\u062f \u062a\u0623\u06cc\u06cc\u062f\u060c \u0634\u0645\u0627 \u0647\u0645 \u0627\u0632 \u0686\u0647\u0631\u06c0 \u062e\u0648\u062f \u0648 \u0647\u0645 \u0627\u0632 \u0634\u0646\u0627\u0633\u06c0 \u062e\u0648\u062f \u0639\u06a9\u0633 \u0645\u06cc\u200c\u06af\u06cc\u0631\u06cc\u062f. \u062e\u062f\u0645\u0627\u062a \u0627\u062d\u0631\u0627\u0632 \u0647\u0648\u06cc\u062a \u0645\u0627 \u0628\u0627 \u0645\u0642\u0627\u06cc\u0633\u06c0 \u062a\u0635\u0648\u06cc\u0631\u06cc \u06a9\u0647 \u0645\u06cc\u200c\u06af\u06cc\u0631\u06cc\u062f \u0628\u0627 \u0639\u06a9\u0633 \u0631\u0648\u06cc \u0634\u0646\u0627\u0633\u0647\u060c \u0647\u0648\u06cc\u062a \u0634\u0645\u0627 \u0631\u0627 \u062a\u0623\u06cc\u06cc\u062f \u0645\u06cc\u200c\u200d\u06a9\u0646\u0646\u062f.",
