    "Discussions are unified; all learners interact with posts from other learners, regardless of the group they are in.": "\u06af\u0641\u062a\u06af\u0648\u0647\u0627 \u06cc\u06a9\u067e\u0627\u0631\u0686\u0647 \u0647\u0633\u062a\u0646\u062f \u0647\u0645\u06c0 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0641\u0627\u0631\u063a \u0627\u0632 \u06af\u0631\u0648\u0647\u06cc \u06a9\u0647 \u062f\u0631 \u0622\u0646 \u0642\u0631\u0627\u0631 \u062f\u0627\u0631\u0646\u062f\u060c \u0628\u0627 \u0628\u062d\u062b\u200c\u0647\u0627\u06cc \u0627\u0631\u0633\u0627\u0644 \u0633\u0627\u06cc\u0631 \u0627\u0641\u0631\u0627\u062f \u062f\u0631 \u062a\u0639\u0627\u0645\u0644\u0646\u062f.",
