    "Do not show again": "\u062f\u0648\u0628\u0627\u0631\u0647 \u0646\u0645\u0627\u06cc\u0634 \u0646\u062f\u0647",
    "Do you want to allow this student ('{student_id}') to skip the entrance exam?": "\u0622\u06cc\u0627 \u0645\u0627\u06cc\u0644\u06cc\u062f \u0628\u0647 \u0627\u06cc\u0646 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u0647 ('{student_id}') \u0627\u062c\u0627\u0632\u0647 \u062f\u0647\u06cc\u062f \u062a\u0627 \u0627\u0632 \u0622\u0632\u0645\u0648\u0646 \u0639\u0628\u0648\u0631 \u06a9\u0646\u062f \u0648 \u0622\u0632\u0645\u0648\u0646 \u0646\u062f\u0647\u062f\u061f",
