    "Document properties": "\u0648\u06cc\u0698\u06af\u06cc\u200c\u0647\u0627\u06cc \u0633\u0646\u062f",
    "Does the name on your ID match your account name: %(fullName)s?": "\u0622\u06cc\u0627 \u0646\u0627\u0645 \u062f\u0631\u062c \u0634\u062f\u0647 \u0631\u0648\u06cc \u06a9\u0627\u0631\u062a \u0634\u0646\u0627\u0633\u0627\u06cc\u06cc \u0628\u0627 \u0646\u0627\u0645 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0634\u0645\u0627 \u0645\u0637\u0627\u0628\u0642\u062a \u062f\u0627\u0631\u062f: %(fullName)s\u061f",
