    "Enter email addresses and/or usernames, separated by new lines or commas, for the learners you want to add. *": "\u0628\u0631\u0627\u06cc \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646\u06cc \u06a9\u0647 \u0645\u0627\u06cc\u0644\u06cc\u062f \u0627\u0636\u0627\u0641\u0647 \u06a9\u0646\u06cc\u062f \u0622\u062f\u0631\u0633 \u0631\u0627\u06cc\u0627\u0646\u0627\u0645\u0647 \u0648 / \u06cc\u0627 \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0631\u0627 \u06a9\u0647 \u0628\u0627 \u062e\u0637\u0648\u0637 \u06cc\u0627 \u0648\u06cc\u0631\u06af\u0648\u0644 \u0627\u0632 \u0647\u0645 \u062c\u062f\u0627 \u0634\u062f\u0647\u200c\u0627\u0646\u062f \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. *",
    "Enter information to describe your team. You cannot change these details after you create the team.": "\u0645\u0637\u0627\u0644\u0628\u06cc \u062f\u0631 \u062a\u0648\u0635\u06cc\u0641 \u062a\u06cc\u0645 \u062e\u0648\u062f \u0628\u0646\u0648\u06cc\u0633\u06cc\u062f. \u0628\u0639\u062f \u0627\u0632 \u0633\u0627\u062e\u062a \u062a\u06cc\u0645 \u0627\u06cc\u0646 \u062c\u0632\u0626\u06cc\u0627\u062a \u0642\u0627\u0628\u0644 \u062a\u063a\u06cc\u06cc\u0631 \u0646\u06cc\u0633\u062a.",
