    "Enter the account information for your organization.": "\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0633\u0627\u0632\u0645\u0627\u0646 \u062e\u0648\u062f \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
    "Enter the enrollment code.": "\u0631\u0645\u0632 \u062b\u0628\u062a\u200c\u0646\u0627\u0645 \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
