    "Enter your {platform_display_name} username or the URL to your {platform_display_name} page. Delete the URL to remove the link.": "\u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc {platform_display_name} \u06cc\u0627 \u0646\u0634\u0627\u0646\u06cc \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u06cc \u0635\u0641\u062d\u06c0 {platform_display_name} \u062e\u0648\u062f \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. \u0628\u0631\u0627\u06cc \u062d\u0630\u0641 \u067e\u06cc\u0648\u0646\u062f\u060c  \u0646\u0634\u0627\u0646\u06cc \u0627\u06cc\u0646\u062a\u0631\u0646\u062a\u06cc \u0631\u0627 \u062d\u0630\u0641 \u06a9\u0646\u06cc\u062f.",
