    "Learners are added to this cohort automatically.": "\u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0628\u0647\u200c\u0637\u0648\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631 \u0628\u0647 \u0627\u06cc\u0646 \u06af\u0631\u0648\u0647 \u0627\u0636\u0627\u0641\u0647 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f.",
    "Learners are added to this cohort only when you provide their email addresses or usernames on this page.": "\u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0641\u0642\u0637 \u0632\u0645\u0627\u0646\u06cc \u0628\u0647 \u0627\u06cc\u0646 \u06af\u0631\u0648\u0647 \u0627\u0636\u0627\u0641\u0647 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f \u06a9\u0647 \u0634\u0645\u0627 \u0646\u0634\u0627\u0646\u06cc \u0631\u0627\u06cc\u0627\u0646\u0627\u0645\u0647 \u06cc\u0627 \u0646\u0627\u0645\u200c\u06a9\u0627\u0631\u0628\u0631\u06cc \u062e\u0648\u062f \u0631\u0627 \u062f\u0631 \u0627\u06cc\u0646 \u0635\u0641\u062d\u0647 \u0627\u0631\u0627\u0626\u0647 \u062f\u0647\u06cc\u062f.",
    "Learners do not see the subsection in the course outline. The subsection is not included in grade calculations.": "\u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0632\u06cc\u0631\u0634\u0627\u062e\u0647 \u0631\u0627 \u062f\u0631 \u0637\u0631\u062d \u062f\u0631\u0633 \u062f\u0648\u0631\u0647 \u0646\u0645\u06cc\u200c\u0628\u06cc\u0646\u0646\u062f. \u0632\u06cc\u0631\u0628\u062e\u0634 \u062f\u0631 \u0645\u062d\u0627\u0633\u0628\u0627\u062a \u0646\u0645\u0631\u0647 \u06af\u0646\u062c\u0627\u0646\u062f\u0647 \u0646\u0634\u062f\u0647\u200c\u0627\u0633\u062a.",
    "Learners do not see whether their answers to assessments were correct or incorrect, nor the score received, until after the due date for the subsection has passed.": " \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u062a\u0627 \u067e\u06cc\u0634 \u0627\u0632 \u067e\u0627\u06cc\u0627\u0646 \u062a\u0627\u0631\u06cc\u062e \u0633\u0631\u0631\u0633\u06cc\u062f \u0632\u06cc\u0631 \u0628\u062e\u0634\u060c \u0635\u062d\u062a \u067e\u0627\u0633\u062e\u200c\u0647\u0627\u06cc \u062e\u0648\u062f \u0648 \u0646\u0645\u0631\u06c0 \u0646\u0647\u0627\u06cc\u06cc \u0631\u0627 \u0646\u06cc\u0632 \u0645\u0634\u0627\u0647\u062f\u0647 \u0646\u062e\u0648\u0627\u0647\u0646\u062f \u06a9\u0631\u062f. ",
