    "Learners who require verification must pass the selected checkpoint to see the content in this unit. Learners who do not require verification see this content by default.": "\u06cc\u0627\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646\u06cc \u06a9\u0647 \u0646\u06cc\u0627\u0632 \u0628\u0647 \u062a\u0623\u06cc\u06cc\u062f \u062f\u0627\u0631\u0646\u062f\u060c \u0628\u0631\u0627\u06cc \u062f\u06cc\u062f\u0646 \u0645\u062d\u062a\u0648\u0627\u06cc \u0627\u06cc\u0646 \u0648\u0627\u062d\u062f \u0644\u0627\u0632\u0645 \u0627\u0633\u062a \u0627\u0632 \u0627\u06cc\u0646 \u0646\u0642\u0637\u06c0 \u06a9\u0646\u062a\u0631\u0644 \u0645\u0646\u062a\u062e\u0628 \u0639\u0628\u0648\u0631 \u06a9\u0646\u0646\u062f. \u0627\u0641\u0631\u0627\u062f\u06cc \u06a9\u0647 \u0628\u0647 \u062a\u0623\u06cc\u06cc\u062f \u0646\u06cc\u0627\u0632 \u0646\u062f\u0627\u0631\u0646\u062f\u060c \u0627\u06cc\u0646 \u0645\u062d\u062a\u0648\u0627 \u0631\u0627 \u0628\u0647\u200c\u0637\u0648\u0631 \u067e\u06cc\u0634\u200c\u0641\u0631\u0636 \u062e\u0648\u0627\u0647\u0646\u062f \u062f\u06cc\u062f.",
