    "No results found for {original_query}. Showing results for {suggested_query}.": "{original_query} \u0646\u062a\u06cc\u062c\u0647\u200c\u0627\u06cc \u062f\u0631 \u0628\u0631 \u0646\u062f\u0627\u0634\u062a. \u0646\u0645\u0627\u06cc\u0634 \u0646\u062a\u0627\u06cc\u062c \u0628\u0631\u0627\u06cc {suggested_query}.",
