    "No transcript uploaded.": "\u0647\u06cc\u0686 \u0632\u06cc\u0631 \u0646\u0648\u06cc\u0633\u06cc \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u0646\u0634\u062f\u0647 \u0627\u0633\u062a.",
    "No validation is performed on policy keys or value pairs. If you are having difficulties, check your formatting.": "\u0647\u06cc\u0686 \u062a\u0623\u06cc\u06cc\u062f \u0627\u0639\u062a\u0628\u0627\u0631\u06cc \u0631\u0648\u06cc \u06a9\u0644\u06cc\u062f\u0647\u0627\u06cc \u062e\u0637 \u0645\u0634\u06cc \u06cc\u0627 \u062c\u0641\u062a \u0645\u0642\u0627\u062f\u06cc\u0631 \u0627\u0646\u062c\u0627\u0645 \u0646\u0645\u06cc\u200c\u0634\u0648\u062f. \u0627\u06af\u0631 \u0645\u0634\u06a9\u0644\u06cc \u062f\u0627\u0631\u06cc\u062f\u060c \u0642\u0627\u0644\u0628\u200c\u0628\u0646\u062f\u06cc \u062e\u0648\u062f \u0631\u0627 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f.",
