    "Onboarding status question": "\u0633\u0648\u0627\u0644 \u0648\u0636\u0639\u06cc\u062a \u0648\u0631\u0648\u062f",
    "Once in position, use the Take Photo button {icon} to capture your ID": "\u067e\u0633 \u0627\u0632 \u0642\u0631\u0627\u0631\u06af\u0631\u0641\u062a\u0646 \u062f\u0631 \u0645\u0648\u0642\u0639\u06cc\u062a \u0645\u0637\u0644\u0648\u0628\u060c \u0627\u0632 \u062f\u06a9\u0645\u06c0 \u0639\u06a9\u0633\u200c\u06af\u0631\u0641\u062a\u0646 {icon} \u0628\u0631\u0627\u06cc \u06af\u0631\u0641\u062a\u0646 \u0634\u0646\u0627\u0633\u0647 \u062e\u0648\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f",
    "Once in position, use the Take Photo button {icon} to capture your photo": "\u067e\u0633 \u0627\u0632 \u0642\u0631\u0627\u0631\u06af\u0631\u0641\u062a\u0646 \u062f\u0631 \u0645\u0648\u0642\u0639\u06cc\u062a \u0645\u0637\u0644\u0648\u0628\u060c \u0627\u0632 \u062f\u06a9\u0645\u06c0 \u0639\u06a9\u0633 \u06af\u0631\u0641\u062a\u0646 {icon} \u0628\u0631\u0627\u06cc \u06af\u0631\u0641\u062a\u0646 \u0639\u06a9\u0633 \u062e\u0648\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f",
    "Once you click \"Yes, end my proctored exam\", the exam will be closed, and your proctoring session will be submitted for review.": "\u067e\u0633 \u0627\u0632 \u06a9\u0644\u06cc\u06a9 \u0628\u0631 \u0631\u0648\u06cc \u00ab\u0628\u0644\u0647\u060c \u067e\u0627\u06cc\u0627\u0646 \u0622\u0632\u0645\u0648\u0646 \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647\u00bb\u060c \u0622\u0632\u0645\u0648\u0646 \u0628\u0633\u062a\u0647 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0648 \u062c\u0644\u0633\u0647 \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647 \u0634\u0645\u0627 \u0628\u0631\u0627\u06cc \u0628\u0631\u0631\u0633\u06cc \u0627\u0631\u0633\u0627\u0644 \u0645\u06cc\u200c\u0634\u0648\u062f.",
    "Once you complete one of the program requirements you have a program record. This record is marked complete once you meet all program requirements. A program record can be used to continue your learning journey and demonstrate your learning to others.": "\u067e\u0633 \u0627\u0632 \u062a\u06a9\u0645\u06cc\u0644 \u06cc\u06a9\u06cc \u0627\u0632 \u0646\u06cc\u0627\u0632\u0647\u0627\u06cc \u0628\u0631\u0646\u0627\u0645\u0647\u060c \u0633\u0627\u0628\u0642\u0647\u200c\u0627\u06cc \u0627\u0632 \u0628\u0631\u0646\u0627\u0645\u0647 \u062e\u0648\u0627\u0647\u06cc\u062f \u062f\u0627\u0634\u062a. \u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u062a\u0645\u0627\u0645 \u0646\u06cc\u0627\u0632\u0645\u0646\u062f\u06cc\u200c\u0647\u0627\u06cc \u0628\u0631\u0646\u0627\u0645\u0647 \u0631\u0627 \u0641\u0631\u0627\u0647\u0645 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f\u060c \u0627\u06cc\u0646 \u0631\u06a9\u0648\u0631\u062f \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0631\u06a9\u0648\u0631\u062f\u06a9\u0627\u0645\u0644 \u0639\u0644\u0627\u0645\u062a\u200c\u06af\u0630\u0627\u0631\u06cc \u0645\u06cc\u200c\u0634\u0648\u062f. \u0627\u0632 \u0633\u0627\u0628\u0642\u0647 \u0628\u0631\u0646\u0627\u0645\u0647 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646 \u0628\u0631\u0627\u06cc \u0627\u062f\u0627\u0645\u06c0 \u0628\u0631\u0646\u0627\u0645\u06c0 \u06cc\u0627\u062f\u06af\u06cc\u0631\u06cc \u0648 \u0646\u0645\u0627\u06cc\u0634 \u06cc\u0627\u062f\u06af\u06cc\u0631\u06cc \u062e\u0648\u062f \u0628\u0647 \u062f\u06cc\u06af\u0631\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f.",
    "Once your account is deleted, you cannot use it to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "\u067e\u0633 \u0627\u0632 \u062d\u0630\u0641 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u062e\u0648\u062f\u060c \u0646\u0645\u06cc\u200e\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u0632 \u0622\u0646 \u0628\u0631\u0627\u06cc \u0634\u0631\u06a9\u062a \u062f\u0631 \u062f\u0648\u0631\u0647\u200c\u0647\u0627\u06cc \u0628\u0631\u0646\u0627\u0645\u0647 {platformName} \u060c {siteName} \u06cc\u0627 \u0647\u0631 \u0648\u0628\u06af\u0627\u0647 \u062f\u06cc\u06af\u0631\u06cc \u06a9\u0647 \u062a\u0648\u0633\u0637 {platformName} \u0645\u06cc\u0632\u0628\u0627\u0646\u06cc \u0634\u062f\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f.",
    "One or more rescheduling tasks failed.": "\u06cc\u06a9 \u0648\u0638\u06cc\u0641\u0647 \u06cc\u0627 \u062a\u0639\u062f\u0627\u062f \u0628\u06cc\u0634\u062a\u0631\u06cc \u0627\u0632 \u0648\u0638\u0627\u06cc\u0641 \u0627\u0646\u062c\u0627\u0645 \u0646\u0634\u062f\u0647 \u0627\u0633\u062a.",
    "Only <%- fileTypes %> files can be uploaded. Please select a file ending in <%- (fileExtensions) %> to upload.": "\u0641\u0642\u0637 \u067e\u0631\u0648\u0646\u062f\u0647\u200c\u0647\u0627\u06cc <%- fileTypes %> \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u0628\u0627\u0631\u06af\u06cc\u0631\u06cc \u0634\u0648\u062f. \u0644\u0637\u0641\u0627\u064b \u067e\u0631\u0648\u0646\u062f\u0647\u200c\u0627\u06cc \u0631\u0627 \u0628\u0631\u0627\u06cc \u0628\u0627\u0631\u06af\u06cc\u0631\u06cc \u0628\u0631\u06af\u0632\u06cc\u0646\u06cc\u062f \u0628\u0647\u200c\u0637\u0648\u0631\u06cc \u06a9\u0647 \u062f\u0631 \u0627\u0646\u062a\u0647\u0627\u06cc \u0622\u0646 <%- (fileExtensions) %>\u0642\u0631\u0627\u0631 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f. ",
    "Only properly formatted .csv files will be accepted.": "\u0641\u0642\u0637 \u067e\u0631\u0648\u0646\u062f\u0647\u200c\u0647\u0627\u06cc \u0633\u06cc \u0627\u0633 \u0648\u06cc \u0628\u0627 \u0642\u0627\u0644\u0628\u200c\u0628\u0646\u062f\u06cc \u0635\u062d\u06cc\u062d \u067e\u0630\u06cc\u0631\u0641\u062a\u0647 \u0645\u06cc\u200c\u0634\u0648\u0646\u062f.",
    "Only the parent course staff of a CCX can create content groups.": "\u0641\u0642\u0637 \u06a9\u0627\u0631\u06a9\u0646\u0627\u0646 \u0627\u0635\u0644\u06cc \u062f\u0648\u0631\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc CCX \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u0646\u062f \u06af\u0631\u0648\u0647\u200c\u0647\u0627\u06cc \u0645\u062d\u062a\u0648\u0627\u06cc\u06cc \u0627\u06cc\u062c\u0627\u062f \u06a9\u0646\u0646\u062f.",
