    "Please enter a term in the {anchorStart} search field{anchorEnd}.": "\u0648\u0627\u0698\u0647\u200c\u0627\u06cc \u0631\u0627 \u062f\u0631 {anchorStart} \u0628\u062e\u0634 \u062c\u0633\u062a\u062c\u0648 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f {anchorEnd}",
