    "Press Remove to remove language": "\u0628\u0631\u0627\u06cc \u062d\u0630\u0641 \u0632\u0628\u0627\u0646\u060c \u062f\u06a9\u0645\u0647 \u062d\u0630\u0641 \u0631\u0627 \u0641\u0634\u0627\u0631 \u062f\u0647\u06cc\u062f",
    "Press UP to enter the speed menu then use the UP and DOWN arrow keys to navigate the different speeds, then press ENTER to change to the selected speed.": "\u0628\u0631\u0627\u06cc \u0648\u0631\u0648\u062f \u0628\u0647 \u0645\u0646\u0648\u06cc \u0633\u0631\u0639\u062a\u060c \u062f\u06a9\u0645\u06c0 \u0628\u0627\u0644\u0627 \u0631\u0627 \u0641\u0634\u0627\u0631 \u062f\u0647\u06cc\u062f\u060c \u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u06a9\u0644\u06cc\u062f\u0647\u0627\u06cc \u062c\u0647\u062a\u200c\u0646\u0645\u0627\u06cc \u0628\u0627\u0644\u0627 \u0648 \u067e\u0627\u06cc\u06cc\u0646 \u0645\u06cc\u200c\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0633\u0631\u0639\u062a \u0631\u0627 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0647\u06cc\u062f\u060c \u0633\u067e\u0633 ENTER \u0631\u0627 \u0628\u0641\u0634\u0627\u0631\u06cc\u062f \u062a\u0627 \u0628\u0647 \u0633\u0631\u0639\u062a \u0645\u0648\u0631\u062f \u0646\u0638\u0631\u062a\u0627\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0646\u062f.",
    "Press change to change selected transcript provider.": "\u0628\u0631\u0627\u06cc \u062a\u063a\u06cc\u06cc\u0631 \u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633 \u0645\u0646\u062a\u062e\u0628\u060c \u062f\u06a9\u0645\u06c0 \u062a\u063a\u06cc\u06cc\u0631 \u0631\u0627 \u0641\u0634\u0627\u0631 \u062f\u0647\u06cc\u062f.",
