    "Press discard changes to discard changes.": "\u0628\u0631\u0627\u06cc \u0644\u063a\u0648 \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a\u060c \u062f\u06a9\u0645\u06c0 \u0644\u063a\u0648 \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u0631\u0627 \u0628\u0632\u0646\u06cc\u062f.",
