    "Press the UP arrow key to enter the language menu then use UP and DOWN arrow keys to navigate language options. Press ENTER to change to the selected language.": "\u06a9\u0644\u06cc\u062f \u067e\u06cc\u06a9\u0627\u0646 UP \u0631\u0627 \u0628\u0641\u0634\u0627\u0631\u06cc\u062f \u062a\u0627 \u0648\u0627\u0631\u062f \u0645\u0646\u0648\u06cc \u0632\u0628\u0627\u0646 \u0634\u0648\u06cc\u062f \u0633\u067e\u0633 \u0627\u0632 \u06a9\u0644\u06cc\u062f\u0647\u0627\u06cc \u062c\u0647\u062a\u200c\u0646\u0645\u0627 \u0628\u0627\u0644\u0627 \u0648 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u0631\u0627\u06cc \u067e\u06cc\u0645\u0627\u06cc\u0634 \u062f\u0631 \u06af\u0632\u06cc\u0646\u0647\u200c\u0647\u0627\u06cc \u0632\u0628\u0627\u0646 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f. \u0628\u0631\u0627\u06cc \u062a\u063a\u06cc\u06cc\u0631 \u0628\u0647 \u0632\u0628\u0627\u0646 \u0627\u0646\u062a\u062e\u0627\u0628 \u0634\u062f\u0647\u060c \u062f\u06a9\u0645\u06c0 ENTER \u0631\u0627 \u0628\u0641\u0634\u0627\u0631\u06cc\u062f.",
    "Press update settings to update course video settings": "\u0628\u0631\u0627\u06cc \u0631\u0648\u0632\u0622\u0645\u062f\u0633\u0627\u0632\u06cc \u062a\u0646\u0638\u06cc\u0645\u0627\u062a \u0648\u06cc\u062f\u0626\u0648\u06cc \u062f\u0648\u0631\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc\u060c \u062f\u06a9\u0645\u06c0 \u0631\u0648\u0632\u0622\u0645\u062f\u0633\u0627\u0632\u06cc \u062a\u0646\u0638\u06cc\u0645\u0627\u062a \u0631\u0627 \u0628\u0641\u0634\u0627\u0631\u06cc\u062f",
