    "Something went wrong. Please try again later.": "\u0645\u0634\u06a9\u0644\u06cc \u067e\u06cc\u0634 \u0622\u0645\u062f\u0647 \u0627\u0633\u062a. \u0644\u0637\u0641\u0627\u064b \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.",
    "Sorry, no results were found.": "\u0639\u0630\u0631\u062e\u0648\u0627\u0647\u06cc \u0645\u06cc\u200c\u06a9\u0646\u06cc\u0645\u060c \u0647\u06cc\u0686 \u0646\u062a\u06cc\u062c\u0647\u200c\u0627\u06cc \u067e\u06cc\u062f\u0627 \u0646\u0634\u062f.",
    "Sorry, there was an error parsing the subtitles that you uploaded. Please check the format and try again.": "\u0645\u062a\u0627\u0633\u0641\u06cc\u0645. \u062e\u0648\u0627\u0646\u062f\u0646 \u0632\u06cc\u0631\u0646\u0648\u06cc\u0633\u200c\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u06a9\u0631\u062f\u06cc\u062f \u0628\u0627 \u0645\u0634\u06a9\u0644 \u0645\u0648\u0627\u062c\u0647 \u0634\u062f. \u0644\u0637\u0641\u0627 \u0642\u0627\u0644\u0628 \u0622\u0646\u200c\u0647\u0627 \u0628\u0627\u0631 \u062f\u06cc\u06af\u0631 \u06a9\u0646\u062a\u0631\u0644 \u06a9\u0631\u062f\u0647 \u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u0633\u0639\u06cc \u06a9\u0646\u06cc\u062f.",
    "Sorry, there was an error trying to process your request. Please try again later.": "\u0645\u062a\u0627\u0633\u0641\u0627\u0646\u0647 \u062e\u0637\u0627\u06cc\u06cc \u062f\u0631 \u0641\u0631\u0627\u06cc\u0646\u062f \u0627\u0646\u062c\u0627\u0645 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0634\u0645\u0627 \u0631\u062e \u062f\u0627\u062f. \u0644\u0637\u0641\u0627 \u0628\u0639\u062f\u0627 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f. ",
    "Sorted by": "\u0645\u0646\u0638\u0645 \u0628\u0631\u062d\u0633\u0628",
    "Source": "\u0645\u0646\u0628\u0639",
    "Source code": "\u06a9\u062f \u0645\u0646\u0628\u0639",
    "Special character": "\u0646\u0648\u06cc\u0633\u06c0 \u062e\u0627\u0635",
    "Specify an alternative to the official course title to display on certificates. Leave blank to use the official course title.": "\u062c\u0627\u06cc\u06af\u0632\u06cc\u0646\u06cc \u0628\u0631\u0627\u06cc \u0639\u0646\u0648\u0627\u0646 \u0631\u0633\u0645\u06cc \u062f\u0648\u0631\u0647 \u0628\u0627 \u0647\u062f\u0641 \u0646\u0645\u0627\u06cc\u0634 \u062f\u0631 \u06af\u0648\u0627\u0647\u06cc\u200c\u0647\u0627 \u0645\u0634\u062e\u0635 \u06a9\u0646\u06cc\u062f. \u0627\u06af\u0631 \u0645\u0627\u06cc\u0644\u06cc\u062f \u0627\u0632 \u0639\u0646\u0648\u0627\u0646 \u0631\u0633\u0645\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0634\u0648\u062f \u0627\u06cc\u0646 \u0642\u0633\u0645\u062a \u0631\u0627 \u062e\u0627\u0644\u06cc \u0628\u06af\u0630\u0627\u0631\u06cc\u062f.",
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam, along with the {linkStart}general proctored exam rules{linkEnd}.": "\u0647\u0631 \u0642\u0627\u0646\u0648\u0646 \u06cc\u0627 \u0627\u0633\u062a\u062b\u0646\u0627\u06cc \u0642\u0627\u0646\u0648\u0646\u06cc \u0631\u0627 \u062a\u0639\u06cc\u06cc\u0646 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u062a\u06cc\u0645 \u062d\u0641\u0627\u0638\u062a \u0647\u0646\u06af\u0627\u0645 \u0628\u0631\u0631\u0633\u06cc \u0648\u06cc\u062f\u0626\u0648\u0647\u0627 \u0622\u0646\u200c \u0645\u0648\u0627\u0631\u062f \u0631\u0627 \u0627\u0639\u0645\u0627\u0644 \u06a9\u0646\u0646\u062f. \u0628\u0647\u200c\u0639\u0646\u0648\u0627\u0646 \u0646\u0645\u0648\u0646\u0647\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0645\u0627\u0634\u06cc\u0646 \u062d\u0633\u0627\u0628 \u0631\u0627 \u0645\u062c\u0627\u0632 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u062f. \u0627\u06cc\u0646 \u0642\u0648\u0627\u0646\u06cc\u0646 \u062a\u0639\u06cc\u06cc\u0646\u200c\u0634\u062f\u0647 \u067e\u06cc\u0634 \u0627\u0632 \u0634\u0631\u0648\u0639 \u0622\u0632\u0645\u0648\u0646 \u062f\u0631 \u06a9\u0646\u0627\u0631 {linkStart} \u0642\u0648\u0627\u0646\u06cc\u0646 \u0639\u0645\u0648\u0645\u06cc \u0622\u0632\u0645\u0648\u0646 \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647 {linkEnd} \u062a\u0648\u0633\u0637 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0642\u0627\u0628\u0644 \u0645\u0634\u0627\u0647\u062f\u0647 \u0627\u0633\u062a.\n\n\u00a0",
    "Specify any rules or rule exceptions that the proctoring review team should enforce when reviewing the videos. For example, you could specify that calculators are allowed. These specified rules are visible to learners before the learners start the exam.": "\u0647\u0631 \u0642\u0627\u0646\u0648\u0646 \u06cc\u0627 \u0627\u0633\u062a\u062b\u0646\u0627\u06cc \u0642\u0627\u0646\u0648\u0646\u06cc \u0631\u0627 \u062a\u0639\u06cc\u06cc\u0646 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u062a\u06cc\u0645 \u062d\u0641\u0627\u0638\u062a \u0622\u0632\u0645\u0648\u0646 \u0647\u0646\u06af\u0627\u0645 \u0628\u0631\u0631\u0633\u06cc \u0648\u06cc\u062f\u0626\u0648\u0647\u0627 \u0622\u0646\u200c\u0647\u0627 \u0631\u0627 \u0627\u0639\u0645\u0627\u0644 \u06a9\u0646\u0646\u062f. \u0628\u0647\u200c\u0639\u0646\u0648\u0627\u0646 \u0646\u0645\u0648\u0646\u0647\u060c \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0645\u0627\u0634\u06cc\u0646 \u062d\u0633\u0627\u0628 \u0631\u0627 \u0645\u062c\u0627\u0632 \u0627\u0639\u0644\u0627\u0645 \u06a9\u0646\u06cc\u062f. \u0627\u06cc\u0646 \u0642\u0648\u0627\u0646\u06cc\u0646 \u062a\u0639\u06cc\u06cc\u0646\u200c\u0634\u062f\u0647 \u067e\u06cc\u0634 \u0627\u0632 \u0634\u0631\u0648\u0639 \u0627\u0645\u062a\u062d\u0627\u0646 \u062a\u0648\u0633\u0637 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0642\u0627\u0628\u0644 \u0645\u0634\u0627\u0647\u062f\u0647 \u0627\u0633\u062a.",
    "Specify whether content-specific discussion topics are divided.": "\u0645\u0634\u062e\u0635 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0645\u0628\u0627\u062d\u062b \u06af\u0641\u062a\u06af\u0648\u06cc \u0648\u06cc\u0698\u06c0 \u0645\u062d\u062a\u0648\u0627 \u062a\u0642\u0633\u06cc\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a \u06cc\u0627 \u062e\u06cc\u0631.",
    "Specify whether discussion topics are divided": "\u0645\u0634\u062e\u0635 \u06a9\u0646\u06cc\u062f \u06a9\u0647 \u0645\u0628\u0627\u062d\u062b \u06af\u0641\u062a\u06af\u0648 \u062a\u0642\u0633\u06cc\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a \u06cc\u0627 \u062e\u06cc\u0631",
    "Speed": "\u0633\u0631\u0639\u062a",
