    "Staff and Learners": "\u06a9\u0627\u0631\u06a9\u0646\u0627\u0646 \u0648 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646",
    "Staff assessment": "\u0627\u0631\u0632\u06cc\u0627\u0628\u06cc \u06a9\u0627\u0631\u06a9\u0646\u0627\u0646",
    "Start Date": "\u062a\u0627\u0631\u06cc\u062e \u0634\u0631\u0648\u0639",
    "Start Exam": "\u0622\u063a\u0627\u0632 \u0622\u0632\u0645\u0648\u0646",
    "Start System Check": "\u0622\u063a\u0627\u0632 \u0628\u0631\u0631\u0633\u06cc \u0633\u0627\u0645\u0627\u0646\u0647",
    "Start generating certificates for all students in this course?": "\u0622\u06cc\u0627 \u0628\u0627\u0632\u062a\u0648\u0644\u06cc\u062f \u06af\u0648\u0627\u0647\u06cc\u200c \u0628\u0631\u0627\u06cc \u0647\u0645\u06c0 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0627\u06cc\u0646 \u062f\u0648\u0631\u0647 \u0622\u0645\u0648\u0632\u0634\u06cc \u0631\u0627 \u0622\u063a\u0627\u0632 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f\u061f",
    "Start my exam": "\u0622\u0632\u0645\u0648\u0646\u0645 \u0631\u0627 \u0622\u063a\u0627\u0632 \u0645\u06cc\u200c\u06a9\u0646\u0645",
    "Start of transcript. Skip to the end.": "\u0645\u062a\u0646 \u0631\u0627 \u0628\u06cc\u0627\u063a\u0627\u0632\u06cc\u062f. \u0628\u067e\u0631 \u0628\u0631\u0648 \u0622\u062e\u0631\u0634.",
    "Start regenerating certificates for students in this course?": "\u0622\u06cc\u0627 \u0628\u0627\u0632\u062a\u0648\u0644\u06cc\u062f \u06af\u0648\u0627\u0647\u06cc\u200c\u0647\u0627\u06cc \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0627\u06cc\u0646 \u062f\u0648\u0631\u0647 \u0631\u0627 \u0622\u063a\u0627\u0632 \u0645\u06cc\u200c\u06a9\u0646\u06cc\u062f\u061f",
    "Start search": " \u0622\u063a\u0627\u0632 \u062c\u0633\u062a\u062c\u0648",
    "Start working toward your next learning goal.": "\u06a9\u0627\u0631 \u0631\u0648\u06cc \u0647\u062f\u0641 \u0628\u0639\u062f\u06cc \u0622\u0645\u0648\u0632\u0634\u06cc\u200c \u062e\u0648\u062f \u0631\u0627 \u0634\u0631\u0648\u0639 \u06a9\u0646\u06cc\u062f.",
    "Started": "\u0634\u0631\u0648\u0639 \u0634\u062f\u0647",
    "Started entrance exam rescore task for student '{student_id}'. Click the 'Show Task Status' button to see the status of the task.": "\u062f\u0631 \u062d\u0627\u0644 \u062a\u06a9\u0645\u06cc\u0644 \u0646\u0645\u0631\u0647\u200c\u062f\u0647\u06cc \u0645\u062c\u062f\u062f \u0622\u0632\u0645\u0648\u0646 \u0648\u0631\u0648\u062f\u06cc \u0628\u0631\u0627\u06cc \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u0647\"{student_id}\"\u0627\u0633\u062a. \u0628\u0631\u0627\u06cc \u0645\u0634\u0627\u0647\u062f\u06c0 \u0648\u0636\u0639\u06cc\u062a \u06a9\u0627\u0631\u060c \u0628\u0631 \u0631\u0648\u06cc \u062f\u06a9\u0645\u06c0 \"\u0646\u0645\u0627\u06cc\u0634 \u0648\u0636\u0639\u06cc\u062a \u06a9\u0627\u0631\" \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f.",
    "Started rescore problem task for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "\u0646\u0645\u0631\u0647\u200c\u062f\u0647\u06cc \u0645\u062c\u062f\u062f \u0628\u0647 \u06a9\u0627\u0631 \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0645\u0633\u0627\u0644\u0647 \u0628\u0631\u0627\u06cc \u0645\u0633\u0627\u0644\u0647 '<%- problem_id %>' \u0648 \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u0647 '<%- student_id %>' \u0622\u063a\u0627\u0632 \u0634\u062f. \u0628\u0631\u0627\u06cc \u0645\u0634\u0627\u0647\u062f\u0647 \u0648\u0636\u0639\u06cc\u062a \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u0628\u0631 \u0631\u0648\u06cc \u062f\u06a9\u0645\u0647 \"\u0646\u0645\u0627\u06cc\u0634 \u0648\u0636\u0639\u06cc\u062a \u06a9\u0627\u0631\" \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f.",
    "Started task to override the score for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "\u0648\u0638\u06cc\u0641\u06c0 \u0646\u0627\u062f\u06cc\u062f\u0647\u200c\u0627\u0646\u06af\u0627\u0631\u06cc \u0627\u0645\u062a\u06cc\u0627\u0632 \u0628\u0631\u0627\u06cc \u0645\u0633\u0627\u0644\u0647 '<%- problem_id %>' \u0648 \u062f\u0627\u0646\u0634\u200c\u0622\u0645\u0648\u0632 '<%- student_id %>' \u0622\u063a\u0627\u0632 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0628\u0631\u0627\u06cc \u0645\u0634\u0627\u0647\u062f\u0647 \u0648\u0636\u0639\u06cc\u062a \u06a9\u0627\u0631\u060c \u0628\u0631 \u0631\u0648\u06cc \u062f\u06a9\u0645\u0647 \"\u0646\u0645\u0627\u06cc\u0634 \u0648\u0636\u0639\u06cc\u062a \u06a9\u0627\u0631\" \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f.",
