    "This section could not be loaded.": "\u0627\u0645\u06a9\u0627\u0646 \u0628\u0627\u0631\u06af\u06cc\u0631\u06cc \u0627\u06cc\u0646 \u0628\u062e\u0634 \u0646\u06cc\u0633\u062a.",
    "This short name for the assignment type (for example, HW or Midterm) appears next to assignments on a learner's Progress page.": "\u0627\u06cc\u0646 \u0646\u0627\u0645 \u06a9\u0648\u062a\u0627\u0647 \u0628\u0631\u0627\u06cc \u0646\u0648\u0639 \u062a\u06a9\u0644\u06cc\u0641 (\u0645\u062b\u0644\u0627\u064b \u060c HW \u06cc\u0627 Midterm) \u062f\u0631 \u06a9\u0646\u0627\u0631 \u062a\u06a9\u0627\u0644\u06cc\u0641 \u062f\u0631 \u0635\u0641\u062d\u06c0 \u067e\u06cc\u0634\u0631\u0641\u062a \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u0647 \u0638\u0627\u0647\u0631 \u0645\u06cc\u200c\u0634\u0648\u062f.",
    "This subsection was released to learners as a proctored exam, but was reverted back to a basic or timed exam. You may not configure it as a proctored exam now. Contact edX Support for assistance.": "\u0627\u06cc\u0646 \u0628\u062e\u0634 \u0641\u0631\u0639\u06cc \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0622\u0632\u0645\u0648\u0646 \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647 \u0628\u0631\u0627\u06cc \u06cc\u0627\u062f\u06af\u06cc\u0631\u0646\u062f\u06af\u0627\u0646 \u0645\u0646\u062a\u0634\u0631 \u0634\u062f\u060c \u0627\u0645\u0627 \u0628\u0647 \u0634\u06a9\u0644 \u0622\u0632\u0645\u0648\u0646 \u067e\u0627\u06cc\u0647 \u06cc\u0627 \u0632\u0645\u0627\u0646\u200c\u0628\u0646\u062f\u06cc \u0634\u062f\u0647 \u0628\u0631\u06af\u0631\u062f\u0627\u0646\u062f\u0647 \u0634\u062f. \u0627\u06a9\u0646\u0648\u0646 \u062f\u06cc\u06af\u0631 \u0627\u0645\u06a9\u0627\u0646 \u067e\u06cc\u06a9\u0631\u0628\u0646\u062f\u06cc \u0622\u0646 \u0628\u0647\u200c\u0634\u06a9\u0644 \u0622\u0632\u0645\u0648\u0646 \u062d\u0641\u0627\u0638\u062a\u200c\u0634\u062f\u0647 \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f. \u0628\u0631\u0627\u06cc \u062f\u0631\u06cc\u0627\u0641\u062a \u0631\u0627\u0647\u0646\u0645\u0627\u06cc\u06cc \u0628\u0627 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u06cc edX \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u06cc\u062f.",
