    "This team is full.": "\u0627\u06cc\u0646 \u062a\u06cc\u0645 \u067e\u0631 \u0627\u0633\u062a.",
    "This thread is closed.": "\u0627\u06cc\u0646 \u0645\u0648\u0636\u0648\u0639 \u0628\u0633\u062a\u0647 \u0627\u0633\u062a.",
    "This unit has validation issues.": "\u0627\u06cc\u0646 \u0648\u0627\u062d\u062f \u0645\u0634\u06a9\u0644\u0627\u062a \u0627\u0639\u062a\u0628\u0627\u0631\u0633\u0646\u062c\u06cc \u062f\u0627\u0631\u062f.",
    "This vote could not be processed. Refresh the page and try again.": "\u0627\u06cc\u0646 \u0631\u0623\u06cc \u0642\u0627\u0628\u0644 \u067e\u0631\u062f\u0627\u0632\u0634 \u0646\u06cc\u0633\u062a. \u0644\u0637\u0641\u0627\u064b \u0635\u0641\u062d\u0647 \u0631\u0627 \u0627\u0632 \u0646\u0648 \u0628\u0627\u0631\u06af\u06cc\u0631\u06cc \u06a9\u0646\u06cc\u062f \u0648 \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.",
