    "Unable to determine whether we should give you a refund because of System Error. Please try again later.": "\u0645\u0634\u062e\u0635 \u0646\u06cc\u0633\u062a \u06a9\u0647 \u0622\u06cc\u0627 \u0628\u0647 \u062f\u0644\u06cc\u0644 \u062e\u0637\u0627\u06cc \u0633\u0627\u0645\u0627\u0646\u0647 \u0628\u0627\u06cc\u062f \u0628\u0647 \u0634\u0645\u0627 \u0628\u0627\u0632\u067e\u0631\u062f\u0627\u062e\u062a\u06cc \u0635\u0648\u0631\u062a \u0628\u06af\u06cc\u0631\u062f \u06cc\u0627 \u062e\u06cc\u0631. \u0644\u0637\u0641\u0627 \u0628\u0639\u062f\u0627\u064b \u062f\u0648\u0628\u0627\u0631\u0647 \u062a\u0644\u0627\u0634 \u06a9\u0646\u06cc\u062f.",
