    "Upload your video thumbnail image.": "\u0628\u0627\u0631\u06af\u0630\u0627\u0631\u06cc \u062a\u0635\u0648\u06cc\u0631 \u0628\u0646\u062f\u0627\u0646\u06af\u0634\u062a\u06cc \u0648\u06cc\u062f\u06cc\u0648.",
    "Uploaded file issues. Click on \"+\" to view.": "\u0645\u0634\u06a9\u0644\u0627\u062a \u067e\u0631\u0648\u0646\u062f\u0647 \u0628\u0627\u0631\u06af\u06cc\u0631\u06cc\u200c\u0634\u062f\u0647. \u0628\u0631\u0627\u06cc \u0645\u0634\u0627\u0647\u062f\u0647 \u0631\u0648\u06cc \u00ab+\u00bb \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f.",
