    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u0627\u0632 \u062f\u0648\u0631\u0628\u06cc\u0646 \u0631\u0627\u06cc\u0627\u0646\u0647\u200c\u062a\u0627\u0646 \u0628\u0631\u0627\u06cc \u062a\u0647\u06cc\u0647 \u0639\u06a9\u0633 \u0627\u0632 \u0686\u0647\u0631\u0647 \u062e\u0648\u062f \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f. \u0645\u0627 \u0627\u06cc\u0646 \u0639\u06a9\u0633 \u0631\u0627 \u0628\u0627 \u0639\u06a9\u0633 \u0631\u0648\u06cc \u06a9\u0627\u0631\u062a \u0634\u0646\u0627\u0633\u0627\u06cc\u06cc \u0634\u0645\u0627 \u062a\u0637\u0628\u06cc\u0642 \u062e\u0648\u0627\u0647\u06cc\u0645 \u062f\u0627\u062f.",
